// src/pages/Home.js
import Layout from '../components/Layout';
import React, { useState, useEffect } from 'react';

const Home = () => {

    const [redSalud, setRedSalud] = useState([]);

    useEffect(() => {
      // Hacemos una solicitud al backend para obtener los datos de los alimentos
      fetch('http://localhost:3001/api/redsalud')
        .then((response) => response.json())
        .then((data) => setRedSalud(data))
        .catch((error) => console.error('Error fetching data:', error));
    }, []);
  
  return (
    <Layout>
      <section className="p-6">
        <h1 className="text-3xl font-bold">Welcome to MyApp</h1>
        <p>This is the homepage content.</p>
      </section>
    </Layout>
  );
};

export default Home;
